static void hann(int32_t* start)
{
    for (size_t i = 0; i < 256; ++i)
    {
        float r1  = win_hamming[i * 2] * (*(start + i * 2));
        float r2  = win_hamming[i * 2 + 1] * (*(start + i * 2 + 1));

        frame[i].R1 = (int16_t)r1;
        frame[i].R2 = (int16_t)r2;
        frame[i].I1 = 0;
        frame[i].I2 = 0;
    }
}

static bool get_energy()
{
    static fft_data_t fft_res[256];
    spinlock_lock(&fft_lock);
    fft_complex_uint16_dma(FFT_DMA_1, FFT_DMA_2, 0, FFT_DIR_FORWARD,
(void*)frame, 512, (void*)fft_res);
    spinlock_unlock(&fft_lock);
    //to power
    for (int i = 0; i < 32; ++i)
    {
        float p1 = (float)fft_res[i].R1 * fft_res[i].R1 + (float)fft_res[i].I1 *
fft_res[i].I1;
        float p2 = (float)fft_res[i].R2 * fft_res[i].R2 + (float)fft_res[i].I2 *
fft_res[i].I2;

        power[i * 2]     = p1;
        power[i * 2 + 1] = p2;
    }
    //to feature
    float sum  = 0;
    for (int i = 0; i < 64; ++i)
    {
        if(power[i] < 1) power[i] = 1;

        power[i] = round(log(power[i]) * 4);
        sum += power[i];
    }
    if(sum < 64)
    {
        for(int i = 0; i < 64; i++)
        {
            power[i] = 0;
        }
    }
    return true;
}


void features_init()
{
    for(int i=0;i < 128;i++)
    {
        for(int j=0;j<64;j++)
        {
            features[i][j] = 0;
        }
    }
}

static void add_feature()
{
    for (int i = 0; i < 64; ++i)
    {
        if(power[i] > 255) power[i] = 255;
        features[feature_index][i] = power[i];
    }

    feature_index++;

    if (feature_index == 128)
    {
        feature_index = 0;
    }
}

void speech_recog_init()
{
    memset(buffer, 0, sizeof(buffer));
}

static void peru()
{
    uint8_t pout_transposed[KPU_FRAME_LEN];
    for(int phw=0; phw<32; phw++){
        for(int pc=0; pc<32; pc++){
            pout_transposed[phw*32 +pc] = ai_output[pc*32 + phw];
        }
    }
    for(int i = 0; i < KPU_FRAME_LEN;i++)
    {
        matrix_peru[i] = pout_transposed[i]*task.output_scale +
task.output_bias;
    }
    return;
}

static void max_0_input()
{
    for(int i = 0;i < KPU_FRAME_LEN; i++)
    {
        if(matrix_peru[i] < 0) matrix_peru[i] = 0;
    }
    return;
}

static void matrix_mul_add_2_7dimension()
{
    for(int i = 0; i < VOICE_7_DIMENSION; i++)
    {
        matrix_mul_add_to_7dimension[i] = 0;
    }
    for(int j = 0; j < VOICE_7_DIMENSION;j++)
    {
        for(int i = 0;i< KPU_FRAME_LEN;i++)
        {
            matrix_mul_add_to_7dimension[j] += matrix_mul[i][j] *
matrix_peru[i];
        }
    }

    for(int i = 0; i < VOICE_7_DIMENSION; i++)
        matrix_mul_add_to_7dimension[i] += matrix_add[i];
    return;
}

